#include<iostream>
#include<string>

std::string str;

std::string strlist[100];

std::string judge;

int count;

int main(){
    
    std::getline(std::cin,str);
    
    std::getline(std::cin,judge);
    
    for(auto&& x:str){
        
        if(x==' ')
            count++;
        
        else
            strlist[count]+=x;
        
    }
    
    for(int i=0;i<=count;i++){
        if(judge.find(strlist[i])!=judge.npos)
            std::cout<<strlist[i]<<std::endl;
    }
    
    return 0;
}
